import React from 'react'
import { HeaderButton, HeaderContainer, HeaderLink } from 'common-components'
import {
  Container,
  menus,
  BtnCont,
  Switch,
  SaveButton,
  CancelBtn,
  constCreate
} from './contsVar'


const Realms = () => {
  let realms = ["sadsdf"]
  return (
    <>
      {/* <SEO title="Manage Realms" /> */}

      <div style={{
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'center',
        paddingBottom: 30
      }}>

        <HeaderLink menu={menus} title="Realms" />
        {realms.length !== 0 && (
          <HeaderButton
            // openFunction={() => setCreate({ ...create, open: true })}
            buttonText="New realm"
          />
        )}
      </div>
    </>
  );
};

export { Realms };
